// CSS
import "./Select.css";

export default function Select({
  placeholder,
  value,
  callback,
  type = "text",
}) {
  return (
    <div className="select-child">
      <select
        type={type}
        className="input_form"
        placeholder={placeholder}
        value={value}
        onChange={callback}
      />
    </div>
  );
}
